INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Sunt et aut rerum doloremque.', 'Dolores aut deleniti soluta officia consectetur error et distinctio. Dignissimos totam ea aut cum quidem animi eum. Ut dignissimos voluptatem ipsum fugiat distinctio alias.', 'Veniam nulla ut nulla vel. Minus ut itaque perspiciatis beatae. Eligendi et mollitia eligendi voluptas nulla.', '1995-06-23');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Maiores minus sed distinctio dolore sunt impedit.', 'Dolorum aliquam facilis quia libero. Eos et iusto porro culpa eos. In sit et eius aliquam quisquam quae. Veritatis quis eaque sit ab dolor.', 'Laudantium autem nisi vitae dolorem voluptate. Repellendus quo aliquid ab.', '1985-03-08');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Provident accusamus suscipit facere architecto.', 'Consequuntur ullam officiis aut perspiciatis aliquid maxime. Rem veritatis illum culpa ducimus aliquid. Et libero veritatis non sunt excepturi. Qui dolorem vel voluptatem eum qui amet qui. Enim provident totam mollitia nemo eligendi atque et.', 'Ut id porro occaecati amet. Vel sit nisi vel corrupti occaecati sequi nesciunt facere. Magni mollitia nisi dolores iusto. Delectus repellat repellat omnis laudantium ut qui.', '2001-03-01');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Veritatis totam est eum rerum qui.', 'Ipsum qui quibusdam et occaecati. Eveniet repudiandae voluptatem facilis magnam alias.', 'Voluptas quidem dicta dignissimos expedita omnis optio. Temporibus voluptatum ipsa cupiditate officiis. Enim aut porro dignissimos illo nulla. Et eos ut iusto voluptatem.', '2004-09-09');
